import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

function Newapp ()
{
    return (
        <div>
            <App />
            <ul>
                <li>Cricket</li>
                <li>Football</li>
                <li>Tennis</li>
            </ul>
        </div>
    )
}

ReactDOM.render(<Newapp />,document.getElementById('root'));
